// Embedded Caveat font (base64-encoded TTF)
//
// Why embed the font as base64?
// When exporting the chart as an image, we need to serialize the SVG to a canvas.
// External fonts loaded via CSS url() or @import are not available during this
// serialization because the browser's security model prevents access to external
// resources. By embedding the font directly as base64 data, we ensure:
//   1. The font is always available for image export (no CORS/security issues)
//   2. The UI and exported images use the exact same font rendering
//   3. The app works fully offline with no external dependencies
//
const CAVEAT_FONT_BASE64 = '';

// Inject font CSS into document for UI consistency with exports
(function () {
    const style = document.createElement('style');
    style.textContent = `
        @font-face {
            font-family: 'Caveat';
            font-style: normal;
            font-weight: 400 700;
            font-display: swap;
            src: url(data:font/truetype;charset=utf-8;base64,${CAVEAT_FONT_BASE64}) format('truetype');
        }
    `;
    document.head.appendChild(style);
})();
